import React, { useEffect, useState } from "react";
import { Spinner, Table, Button } from "react-bootstrap";
import useAuth from "../../Hooks/useAuth";
import logo from '../../Images/logo.png';
import jsPDF from 'jspdf'
import { applyPlugin } from 'jspdf-autotable'
applyPlugin(jsPDF)


const MyBookings = () => {
  const { user } = useAuth();
  const [bookings, setBookings] = useState([]);
  const [isLoading, setLoading] = useState(true);

  useEffect(() => {
    fetch(`https://travele-tourism-server.onrender.com/myBookings/${user?.email}`)
      .then((res) => res.json())
      .then((data) => {
        setBookings(data);
        setLoading(false);
      });
  }, [user?.email]);

  const handleDelete = (id) => {
    const checker = window.confirm("Are you sure to delete?");
    if (checker) {
      fetch(`https://travele-tourism-server.onrender.com/deleteBooking/${id}`, {
        method: "DELETE",
        headers: { "content-type": "application/json" }
      })
        .then((res) => res.json())
        .then((data) => {
          if (data.deletedCount) {
            // If booking is deleted successfully, fetch bookings again to update the list
            setLoading(true);
            fetch(`https://travele-tourism-server.onrender.com/myBookings/${user?.email}`)
              .then((res) => res.json())
              .then((data) => {
                setBookings(data);
                setLoading(false);
              });
          } else {
            setLoading(false);
          }
        });
    }
  };

  const calculateTotalPrice = (price) => {
    // Calculate total price with tax
    const taxPercentage = 18; // 18% tax
    const fixedPrice = 5000; // Fixed price
    const totalPrice = fixedPrice + (fixedPrice * (taxPercentage / 100));
    return totalPrice;
  };

  const downloadInvoice = () => {
    // Create new jsPDF instance
    const doc = new jsPDF();

    // Set the properties for the PDF
    doc.setFontSize(12);
    doc.text(20, 20, 'Invoice');

    // Add logo
    const imgWidth = 50;
    const imgHeight = 50;
    doc.addImage(logo, 'PNG', 20, 30, imgWidth, imgHeight);

    // Generate table headers
    const headers = ['Tour Name', 'Booked by', 'Phone', 'Address', 'Status', 'Price (INR)', 'Total Price (INR)'];
    const rows = bookings.map((booking, index) => {
      const totalPrice = calculateTotalPrice(booking.price);
      return [
        booking.tourName,
        booking.email,
        booking.phone,
        booking.address,
        booking.status,
        `₹5000`,
        `₹${totalPrice.toFixed(2)}`
      ];
    });

    // Add the table to the PDF
    doc.autoTable(headers, rows);

    // Save PDF
    doc.save(`Invoice.pdf`);
  };

  return (
    <div className="container">
      <h2 className="text-center blue-color">My Bookings</h2>
      <div className="table-responsive">
        {isLoading ? (
          <Spinner animation="border" role="status">
            <span className="visually-hidden">Loading...</span>
          </Spinner>
        ) : (
          <Table striped bordered hover>
            <thead>
              <tr>
                <th>#</th>
                <th>Tour Name</th>
                <th>Booked by</th>
                <th>Phone</th>
                <th>Address</th>
                <th>Status</th>
                <th>Action</th>
                <th>Download Invoice</th>
              </tr>
            </thead>
            <tbody>
              {bookings.map((booking, index) => (
                <tr key={booking._id}>
                  <td>{index + 1}</td>
                  <td>{booking.tourName}</td>
                  <td>{booking.email}</td>
                  <td>{booking.phone}</td>
                  <td>{booking.address}</td>
                  <td>{booking.status}</td>
                  <td>
                    <Button onClick={() => handleDelete(booking._id)} variant="danger">
                      Cancel
                    </Button>
                  </td>
                  <td>
                    <Button onClick={downloadInvoice} variant="success">
                      Download Invoice
                    </Button>
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
        )}
      </div>
    </div>
  );
};

export default MyBookings;
